{"services_in_this_area": null, "ber_detail": ["BER: E2", "BER No. XXX", "Energy Performance Indicator: XXX kWh/m/yr"], "features": ["The small village of Ahakista is situated in the centre of the Sheepshead Peninsula. It is in an area much sought after by tourists and property seekers alike. There are two pubs and a restaurant within walking distance and a church and primary school close by.", "The road which leads from Durrus to Ahakista runs alongside Dunmanus Bay and is most spectacular. Before you enter Ahakista, you will see the Air India Memorial on your left. Shortly after the sign for Ahakista, you will see a new pier which adjoins the harbour. Many boats operate from here for both fishing and pleasure. The Sheepshead Way passes by Ahakista.", "Boat trips to the small Islands to view the seals is a must. Sailing is also available. You are safe to swim in the many small beaches in the area.  There are some lovely gardens open to the public.", "For those who like to explore, a drive to the end of the Peninsula is just 20 minutes. The 'Ring Road' continues over the scenic 'Goath's Path' with superb views over Dunmanus and Bantry Bays. You can drive onto Bantry along the 'Goat's Path' road overlooking Bantry Bay. Glengarriff and the Beara Peninsula are just a 30 minute drive. The Mizen Head peninsula including Barley Cove beach, Schull and Ballydehob are fantastic day trips.", "There are many places of interest all over West Cork and within easy reach from Ahakista. Many visitors return year after year to this place that they refer to as 'A little bit of Heaven'.", "Hillcrest House is a modern and fully equipped 3 bedroom bungalow with privateentrance, enclosed gardenand on- site parking located in a very scenic spot with sea views over the Ahakista harbour. The property is within walking distance to2 bars, a church and a primary school and the village of Durrus is a 10 minute drive as is the prettycoastal village ofKilcrohane. Bantry is a 20 journey by car and Cork City is just under 2 hours.", "The property is located in the heart of the renowned Sheep's Head Way walking trail - a perfect base for serious walkers/hikers and those who just want a leisurely stroll.", "The property comprises:kitchen/dining - fully fitted kitchen with all appliances living room with open fire utility room with washer and dryer - storage area shower room bathroom 3 bedrooms - all with wash basinsRATES &", "AVAILABILITY:", "From 13th September, 2014 - 550 per month (ex. all utilities)"], "agentFax": "027 67068", "negotiator": null, "agentName": "Peninsula Properties", "property_type": "3 Bed Bungalow 900 ft / 83.61 m To Let  7 months lease", "leaseTerm": "7 months Lease", "latitude": 51.5979741870766, "description": "Available to rent from November 2015 to May 2016. 3 bedroom fully furnished and equipped detached bungalow. Conveniently situated off the main road a quarter of a mile from Ahakista Village on the Sheepshead Peninsula in a picturesque and peaceful setting overlooking the Ahakista harbour and Dunmanus Bay.", "price": "550 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/5/0/4/212405/Entrance_l.JPG", "http://photos-a.propertyimages.ie/media/5/0/4/212405/Front%20view_l.JPG", "http://photos-a.propertyimages.ie/media/5/0/4/212405/Side%20view%20%26%20harbour_l.JPG", "http://photos-a.propertyimages.ie/media/5/0/4/212405/Garden%20%26%20Sea%20View_l.JPG", "http://photos-a.propertyimages.ie/media/5/0/4/212405/Garden_l.JPG", "http://photos-a.propertyimages.ie/media/5/0/4/212405/View%20(2)_l.JPG", "http://photos-a.propertyimages.ie/media/5/0/4/212405/Front%20of%20bungalow_l.JPG", "http://photos-a.propertyimages.ie/media/5/0/4/212405/Entrance%20(Pic%202)_l.JPG", "http://photos-a.propertyimages.ie/media/5/0/4/212405/View_l.JPG", "http://photos-a.propertyimages.ie/media/5/0/4/212405/hilcrest%201_l.jpg", "http://photos-a.propertyimages.ie/media/5/0/4/212405/hilcrest%203_l.jpg", "http://photos-a.propertyimages.ie/media/5/0/4/2124