{"services_in_this_area": null, "ber_detail": ["BER: C3", "BER No. 102778040", "Energy Performance Indicator: 216.41kWh/m/yr"], "features": ["Furnished", "Parking", "Central Heating", "Washing Machine", "Microwave", "Step-free Access", "Walk-in Shower", "Wheelchair Access"], "agentFax": "0505 24001", "negotiator": null, "agentName": "Victor Mitchell", "property_type": "2 Bed Terraced House To Let  1 year lease", "leaseTerm": "1 year Lease", "latitude": 52.9844035, "description": "For over 55's only. First occupancy since construction.,Fine 2 Bed Properties Built to a High Standard, Available for Immediate Occupation in the Heart of the Picturesque Village of Shinrone. Located in a Quiet and Peaceful Area behind Clover Lodge Nursing Home, these Bright and Spacious Single Storey Houses are being offered to rent Fully Furnished.,The Properties comprise of Fully Fitted Kitchen, Sitting Room with Gas Fire Insert, 2 Bedrooms, 1 en-suite with walk-in shower, both with Fitted Wardrobes, Bathroom. Gas Central Heating. Wheelchair Accessible.,In order to qualify to live in this small Development of just 24 houses, tenants must be aged 55 or over, or a younger person with a disability or certified medical condition may also be eligible.,Directions:  ,From Roscrea: ,From the town centre, drive to the bottom of either Limerick Street or Abbey Street, where you will meet a junction  turn right and follow the signage for Shinrone. Continue, keeping on the same road for 6.5 miles. At the T-Junction of the village, turn left. After 200 yards, turn left for Clover Lodge Nursing Home. The Retirement Village is located to the rear of the Nursing Home.,From Birr: ,Drive along the Roscrea - Birr Road (N62) for approx. 4.5 miles, until you meet crossroads adjoining a public house called The Black Bull. Turn right, following signage for Shinrone and Cloughjordan.  Continue along this road for approx. 1.5 miles to Shinrone. Continue in to the village, passing the Catholic Church and a Nation