{"services_in_this_area": null, "ber_detail": ["BER:", "BER No. XXX", "Energy Performance Indicator: XXX kWh/m/yr"], "features": ["Furnished", "Unfurnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Microwave", "Cable TV", "Internet", "Alarm"], "agentFax": null, "negotiator": null, "agentName": "Appleton Property", "property_type": "4 Bed Detached To Let", "leaseTerm": null, "latitude": 53.1581414, "description": "FIRST LETTING ** Appleton Property have great pleasure in bringing another fine corporate standard property to the letting market. Tudor Lodge is a large family home on a half acre site located where Newbridge Town meets The Curragh Plains on The Green Road at Lumville.This elegant property is approached off the Green Road on tarmac drive through automated electric gates. With double garage with remote access shutters there is ample parking both indoor and on the tarmac drive way. The house itself is entered through a porch into an elegant entrance hallway with turning oak staircase and oak floor. To the left and to the right there are two equally large reception rooms currently furnished to a high standard with chandaliers and various electrical, TV and Lamp points. To the rear of the property overlooking the gardens is the open plan kitchen and dining room. This is a bright space with timber floor, fully fitted traditional kitchen with granite counter tops, American fridge, Aga Style Cooker, and Dishwasher. There is a large dining area to the other side of the kitchen which flows into one of the reception rooms to the front. Off the Kitchen there is a large Utility Room with second Fridge and Freezer and Guest WC. Upstairs there are four bedrooms all with quality blinds, curtains and poles. All rooms can easily house a double bed. The four bedrooms are currently laid out as three doubles and a twin room. Two of the Double Bedrooms are Ensuite and also have walk in wardrobes. The remaining bedrooms have sliderobe wardrobes.