{"services_in_this_area": null, "ber_detail": null, "features": ["Two Ensuite Bathrooms, in addition to bathroom and guest WC.", "Brick, Dash and Render Finish to Low Maintenance Exterior", "PVC Facia Soffit", "PVC Double Glazed Windows", "Granite Window Cills and Pillar Caps", "Two wide side entrances both gated", "Brick wall with granite pillars to front of house with tarmac drive", "Gas Fired Central Heating", "Freshly Painted", "New Flooring to all bedrooms", "New Blinds Fitted throughout.", "Black out blinds newly fitted to bedrooms.", "Not overlooked to front or to rear", "End of Cul de sac location", "Brass / Candle Chandelier to hallway and living room", "Coving to both reception rooms", "Built in wardrobes to all bedrooms", "Large Utility space off kitchen", "Accommodation", "Entrance Hallway 5.17m x 1.35m Large Bright Hallway, Rad Cabinet, 2 Candle Chandeliers", "Living Room 4.4m x 4.05m Coving, Double Curtains into Bay, Granite FP, Candle Chandeliers", "2nd Reception Room 3.67m x 2.69m Coved Ceiling, Brass Candle Chandelier, Curtains, New Blinds", "Kitchen/Dining 7.1m x 2.89m Large stylish open plan room with double doors to private garden.", "Fitted oak shaker style kitchen, matching oak lighting set, curtains.", "Rear Hall/Utility 4.0m x 2.0m Useful Utility space with side door, storage, housing WM and boiler", "Guest WC 2.86m x 1.0m Tiled Floor, Radiator Cabinet, Curtains, tastefully decorated.", "Master Bedroom 4.03m x 3.9m New Carpet, Ensuite, Heavy Lined Curtains, 5 x built in Wardrobe.", "Ensuite 1 1.7m x 1.6m Tiled Ensuite with pumped shower and white sanitary fittings", "Bedroom 2 3.54m x 3.4m New Carpet, Heavy Lined Curtains, Built in wardrobes, with Ensuite", "Ensuite 2 2.0m x 1.67m Tiled Ensuite with Mira Elite Shower, white sanitary fittings.", "Bedroom 3 3.8m x 2.8m New Carpet, Double Bedroom with built in wardrobes.", "Bedroom 4 3.0m x 2.91m New Carpet, Double currently laid out as single with built in storage.", "Bathroom 2.52m x 1.8m Floo