{"services_in_this_area": null, "ber_detail": ["BER:", "BER No. XXX", "Energy Performance Indicator: XXX kWh/m/yr"], "features": ["Furnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Microwave", "Internet", "References Required"], "agentFax": null, "negotiator": "Negotiator: Mary Cotter", "agentName": "Irish Rural Homes", "property_type": "4 Bed Detached To Let", "leaseTerm": "Lease Term: ", "latitude": 51.5605873349958, "description": "Cooragurteen, Ballydehob, Co. Cork,300 Weekly House to let|4 Beds|3 Baths ,4 Bedrooms (4 twin), 3 Bathrooms,4 BED 2 ON SUITE ULTRA MODERN HOLIDAY HOME BALLYDEHOB, CO CORK. OFF PEAK 300,00 A WEEK INCLUDING UTILITIES. PLEASE EMAIL ME FOR RATES.,We have been instructed by of our valued client to offer for rent this very attractive roadside ultra-modern 4 bed 2 on suite Holiday Home with a large fitted Kitchen, Dining Room, and Sitting Rooms, Bathroom Utility Room. Oil Fired Central Heating, ,The site has panoramic views of Roaring Water Bay and the surrounding country side... It has road frontage and is south facing. ,Ballydehob is a charming village on the south west coast of Ireland. Lying about 20 miles east of Mizen Head, And Barley Cove, possibly the best swimming area in Ireland. Its Europe's most westerly point, it is embraced by colourful hills and rich natural beauty and wildlife; the perfect place from which to explore West Cork.,Ideal base for fishing or sailing.,The village and its environs have a vibrant and diverse population, and the variety of bars, good eating places, fun festivals and community events ensure a warm welcome. ,Enjoy a walk by the river and across the 12 arch bridge, and take a stroll through the village and maybe participate in some 'light refreshments'. And don't forget to experience Ballydehob by night either - live music and the craic are all part of the make up!,It is situated on the South West coast of Ireland, West of Cork City. Here where the Gulf Stream practically touches the coast, there is a rich diversity of wildlife to be found in the area with many rare and unusual plants.,The property is located 1.9K from Ballydehob on the Schull road. It is in a private location but is not remote. All services including Electricity, telephone and broadband are in the house. ,There is a Daily West Cork Rural Transport Scheme Serving Communities in West Cork and this Community rural bus service has a door to door service at very reasonable rates and it is even free of charge to senior citizens, you just give them a ring and let them know that you are going to town today.", "price": "300 / week", "image_urls": ["http://photos-a.propertyimages.ie/media/4/4/4/2732444/aW1hZ2Uvd1Z5WFVXdkE1Tzh3YXI3SEc0Q1RsX282Yy1IRWRTdFFBWTZyZDNCNnJCTnNQVGd3TUE9PS5qcGd8NjA5fHx8fHx8aHR0cDovL3d3dy5kYWZ0LmllL2kvd2F0ZXJtYXJrLnBuZz92PTF8fHw%3D%5B1%5D_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "Cooragurteen, Ballydehob, Cork", "shortLink": "www.myhome.ie/2732444", "url": "http://www.myhome.ie/rentals/brochure/cooragurteen-ballydehob-cork/2732444", "longitude": -9.47062683262629, "beds": 4, "agentPhone": "085 7399250", "deposit": 300, "ber": null, "agentAddress": "Cappaghglass, Ballydehob, West Cork", "addedOnDate": "Added 1 year ago, refreshed 2 months ago"}
{"services_in_this_area": null, "ber_detail": ["BER:", "BER No. XXX", "Energy Performance Indicator: XXX kWh/m/yr"], "features": ["Furnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Microwave", "Internet", "References Required"], "agentFax": null, "negotiator": "Negotiator: Mary Cotter", "agentName": "Irish Rural Homes", "property_type": "3 Bed Detached To Let  1 year lease", "leaseTerm": "1 year Lease", "latitude": 51.7273821894019, "description": "Mallabrack, Dunmanway, Co. Cork,600 Monthly ,Furnished ,3 Bedrooms (3 twin), 2 Bathrooms,Short time lets at Mallabrack, Sam Maguire Cottages, Dunmanway Monthly rental the rates vary email me for a price.,Sam Maguire Cottages,The Sam Maguire Complex is a beautiful development of eight detached houses situated in the picturesque West Cork countryside. These houses are just a six minute drive to Dunmanway town and are an ideal base to explore West Cork from. Bantry, Inchydoney, Clonakility, Baltimore and Glengarriff are all within easy driving distance. . All services including Electricity, telephone and broadband are in the house there is a bus to school from the house. There is a Daily West Cork Rural Transport Scheme Serving Communities in West Cork and this Community rural bus service has a door to door service at very reasonable rates and it is even free of charge to senior citizens, you just give them a ring and let them know that you are going to town today.,Each architecturally designed house has been fitted out to the highest standard and offers luxurious, spacious accommodation. These three bedroomed houses which sleep seven offer the very best in modern comfort. The accommodation comprises of a master double room en suite with plasma screen T.V., one double & single room and a second double room en suite. This beautiful complex boasts a number of unique attractions in the immediate area. It is the birth place of GAA legend Sam Maguire, who gave his name to the All Ireland Senior Football trophy. The Sam Maguire visitor centre is located just sixty metres from the houses. The famous Sam Maguire festival is an annual event in Dunmanway and takes place in September.,Dunmanway the friendly heart and geographical centre of the region known as West Cork. Dunmanway is a 17th century planned town and the original two triangular squares still survive. Various sources list its meaning when translated from Irish as \"the castle of the yellow river,\" \"the castle on the little plain,\" \"the fort of the gables (or pinnacles),\" and \"the fort of the yellow women.\" It is best known as the birthplace of Sam Maguire the man for whom the All Ireland Senior Football trophy is named.,. ,Features,'' Colour TV in living room,'' Plasma TV in master bed room,'' Kitchen including microwave, dishwasher, washing machine/dryer,'' Bed linen and duvets provided,'' Beds are made up on arrival,'' Cots are available on request,'' Private car parking,'' Electric Central Heating,Viewing Details: Strictly By Appointment with Agent ,087 183 3096", "price": "600 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/0/4/4/2732440/aW1hZ2Uvb202Q251Q3Y0T2VMSC1PTzJzS21uV0ZXUmE5Yjh0YWY4b1NEVlBkcDgtOXNQVGd3TUE9PS5qcGd8NjA5fHx8fHx8aHR0cDovL3d3dy5kYWZ0LmllL2kvd2F0ZXJtYXJrLnBuZz92PTF8fHw%3D%5B1%5D_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "Malbrack, Dunmanway, Cork", "shortLink": "www.myhome.ie/2732440", "url": "http://www.myhome.ie/rentals/brochure/malbrack-dunmanway-cork/2732440", "longitude": -9.11937713215593, "beds": 3, "agentPhone": "085 7399250", "deposit": 600, "ber": null, "agentAddress": "Cappaghglass, Ballydehob, West Cork", "addedOnDate": "Added 1 year ago, refreshed 2 months ago"}
