{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "01 4959028", "negotiator": null, "agentName": "MTS Sales & Lettings", "property_type": "2 Bed Apartment To Let", "leaseTerm": null, "latitude": 53.292369, "description": "Excellent value!! MTS Property are delighted to bring to the market this stunning apartment in Loreto Abbey.,This property is a superb 2 bedroom in the prestigious Loreto Abbey development which was built in recent years right at the village of Rathfarnham beside an abundance of amenities. ,Rathfarnham has long been regarded as one of the most popular and desirable locations in Dublin due to several factors including the character and convenience of the area, the settled nature, the tree lined roads and the abundance of amenities, open spaces and leisure pursuits.,Rathfarnham village has retained all its intimacy and character with a sensitive redevelopment of its core and the addition of numerous new local shops, services and facilities making it so much easier to access all parts of Dublin and surrounding counties. ,The M50 has been particularly significant in this regard.,There are several landmark and educational buildings in this area. Loreto Abbey is one of the most prominent. Loreto Abbey, or Rathfarnham House as it was formally known, was built in 1725 for William Palliser. It was well regarded in social and cultural terms and guests who visited include Handel, Dean Swift and Thomas Moore.,After the Act of Union, the then owners moved from Rathfarnham House to the local Woodstown House.,This is a mature residential location with a fine selection of houses and apartments well served by many local shops, sporting and leisure facilities, not least being Marley Park, one of Europe' s finest parks. There are good transport facilities and also easy access to the M50. Dundrum Town Centre is also convenient.,This stunning property comprises of a living / dining room & breakfast area, a separate well fitted kitchen, 2 bedrooms, en suite, main bathroom and storage and also boasts a balcony.,Priced to let 1450 per month.,Professional tenants only.,Viewing are strictly by appointment.        ,", "price": "1400 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/6/0/2/3356206/ca9447e1-6d47-4d54-9f1c-43f725a38534_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/fbf9b7a1-048c-43ee-b855-e2e9d14466d2_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/458f3f0e-4dd3-4f15-83fc-5e31ca2ff399_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/7753b5ad-5bfe-40b9-b619-1b8236f3f9f3_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/80c215ef-3b5d-4556-aa32-2155b090ec72_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/0f7fba0b-ecbc-4d4d-b3cd-7ee22fa78bc7_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/af1f7f43-2e58-49e9-8baf-09c3758d7985_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/d5421eac-b2fa-4572-8bc3-1eedae86cd42_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/00c68d0f-4027-4f35-812b-6ed7a282a4ec_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/d9bcc2b3-c685-48e6-abeb-06fda98b01f4_l.jpg", "http://photos-a.propertyimages.ie/media/6/0/2/3356206/248b1779-e00b-44be-b1a8-f64a3621a29e_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "Loretto Abbey, Rathfarnham, Dublin 14", "shortLink": "www.myhome.ie/3356206", "url": "http://www.myhome.ie/rentals/brochure/loretto-abbey-rathfarnham-dublin-14/3356206", "longitude": -6.279864, "beds": 2, "agentPhone": "01 4959020", "deposit": null, "ber": null, "agentAddress": "1 Orwell Road, Rathgar, Dublin South, Ireland", "addedOnDate": "Added 2 months ago, refreshed 2 months ago"}
