{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "045 861276", "negotiator": null, "agentName": "Sherry FitzGerald Reilly", "property_type": "232.3 m / 2500 ft To Let", "leaseTerm": null, "latitude": 53.325161, "description": "An opportunity to rent a unique and charming 4/5 bedroom residence, originally constructed in the late 19th century but converted in 1977 by the addition of a modern dormer extension.,The house extends to circa 2,500 sq ft, on approximately 0.5 acres of secluded grounds in a tranquil setting with abundant wild life and leafy foliage.,The property is entered through a stone gateway into a large courtyard. The interior accommodation of the residence is very spacious and will meet the needs of any growing family. There are many special features and hidden extras, including more-than ample storage, sunlit kitchen, windows facing both east and west, many rooms being dual-aspect.,Some of the outstanding features of 'Mount Egan' are the mature grounds with extensive lawns, large patio area, orchard, soft-fruit cage, flower beds and a wonderful array of plants, shrubs, beech hedges and mature trees, all of which combine to create a haven of tranquillity all year round.,The property is situated in a quiet rural setting, only a stone's throw from Donadea Forest Park, a mile away from excellent small national school and 3 miles distant from Clane village. Local amenities include golf, tennis, rugby, GAA, soccer, swim/leisure facilities, canal/ forest walks etc.,Dublin city is easily accessible via either the M4 or M7 motorways (non rush-hour travelling time to city or airport is approx 45 mins). There is a frequent bus-service from Clane and Rail service from both Sallins and Maynooth to Dublin.,A property not to be missed!!  Viewing highly recommended. Term of the lease agreement is 6 months with the option of extension.", "price": "1350 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/4/6/0/3369064/fb25b1