{"services_in_this_area": null, "ber_detail": ["BER: C1"], "features": ["Close to Carrick on Shannon", "Short drive to the N4"], "agentFax": "071 964 5556", "negotiator": null, "agentName": "Gordon Hughes Estates Agents ", "property_type": "3 Bed SemiDetached To Let", "leaseTerm": null, "latitude": 53.9831948, "description": "This is a fully completed residential development located in the picturesque village of Cootehall on the banks of the river Shannon. Situated only a 10m drive from Carrick-on-Shannon & Boyle just off the N4 & less than a 2 hour drive from Dublin it is ideally suited for those seeking a family home or holiday retreat.  New to the rental market is a three bedroom semi-detached letting Agent.", "price": "475", "image_urls": ["http://photos-a.propertyimages.ie/media/3/0/6/3378603/942e0e29-7e21-48a1-b50b-d7b53e32d483_l.jpg", "http://photos-a.propertyimages.ie/media/3/0/6/3378603/0e739221-188c-4e8f-9109-c1f16530005f_l.jpg", "http://photos-a.propertyimages.ie/media/3/0/6/3378603/82d2beeb-8e70-489f-a002-ebeee4832c59_l.jpg", "http://photos-a.propertyimages.ie/media/3/0/6/3378603/844fd867-437e-47c3-98a5-aa8541a58a24_l.jpg", "http://photos-a.propertyimages.ie/media/3/0/6/3378603/61140c0d-0f43-4c1c-b8c5-896680eb31c8_l.jpg", "http://photos-a.propertyimages.ie/media/3/0/6/3378603/3c35ec04-7725-44cd-b597-737e77b371bb_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "No.7 Oakport, Cootehall, Co. Roscommon", "shortLink": "www.myhome.ie/3378603", "url": "http://www.myhome.ie/rentals/brochure/no-7-oakport-cootehall-co-roscommon/3378603", "longitude": -8.1575729, "beds": 3, "agentPhone": "071 964 5555", "deposit": null, "ber": "C1", "agentAddress": "Main Street , Ballinamore , Co. Leitrim , ", "addedOnDate": "Added 1 month ago, refreshed 1 month ago"}
{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "096 75927", "negotiator": null, "agentName": "Fox & Gallagher", "property_type": "4 Bed House To Let  1 year lease", "leaseTerm": "1 year Lease", "latitude": 53.6810067239352, "description": "From the N59 Westport Road a well maintained minor road covers the 1.2 miles to a farm entrance. A drive leads up to the main house with a garage, gardens and patio area surrounded by a stone wall. The gardens are lawned with a large gravelled parking area to the side. The patio includes a bannistered deck with play area. The front door leads into a wide reception area with an attractive curved wall at the end that separates the living and sleeping quarters. The reception rooms include a large lounge with fireplace and bay window, a smaller sitting room with fireplace and a front-facing study. The kitchen and dining room are separated by a peninsula unit with units above, with French Doors leading to the patio. Leading off is a utility room with door to the rear garden and a W.C./shower room. The sleeping area provides four double bedrooms, two with ensuite bathrooms and a family bathroom. The master bedroom (ensuite) has a bay window with fine views of Croagh Patrick. Two of the bedrooms have a fine range of built in furniture including wardrobes and storage units. The bathroom has both a bath and a shower cubicle, is tiled and has a window to the rear. The views from all the windows are sensational . The Owenmore River runs close to the house and the surrounding hill farm is an excellent example of the rugged beauty of the West of Ireland. The middle distance is dominated by Croagh Parick to the front and the pilgrims path and crowning church are clearly visible. To the side and rear are the Mweelrea Mountains that provide a dramatic back-drop to the open farmland.The stone-fronted house and dry-stone walls fit in perfectly with this environment. AN ADDITIONAL TWO ACRES AT THE REAR OF THE HOUSE I