{"services_in_this_area": null, "ber_detail": null, "features": ["C 2150 sq ft", "Elevated site with views of Lambay Island", "Detached home", "Excellent condition", "Oil fired central heating", "Double glazed windows", "Family bathroom", "Guest wc/whb/walk-in shower", "Extensive well finished decked area", "3 reception rooms", "5 bedrooms", "Ample off street parking", "Superb location near Howth village", "Unfurnished", "Parking", "Central Heating", "Suits Professionals", "References Required"], "agentFax": "01 854 0026", "negotiator": "Negotiator: Conor Gallagher", "agentName": "Gallagher Quigley", "property_type": "5 Bed Detached 2150 ft / 199.74 m To Let  1 year lease", "leaseTerm": "1 year Lease", "latitude": 53.3736322, "description": "San Jose is an attractive detached property perched upon an elevated site of approximately   acre of private landscaped gardens. Ideally located above the picturesque village of Howth, this endearing home enjoys convenient access to all of the wonderful amenities the amazing Howth peninsula has to offer.,This home has been transformed from its once modest origins into a bright well-appointed family residence with all modern conveniences now in place.,Viewers will be greeted by the extensive cobble locked driveway with off street parking available for several vehicles. A few steps lead from here up to an elevated front deck which is occasionally used for evening barbeques and is an ideal area from which to take in the surrounding vista of Howth hill towards the west and views of Lambay island towards the north.,At approximately c200 sq m or (c2150 sq ft) this home is spacious and comfortable.The enclosed entrance porch leads to the reception hall which is tastefully tiled and is lit by several downlighters. The staircase features a stainless steel hand rail and glass panels and there is ample under stairs storage.,Off the hall is the main living room which is generously proportioned and finished with varnished floor boards and a 