{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "01 6766340", "negotiator": null, "agentName": "Hooke & MacDonald", "property_type": "5 Bed To Let", "leaseTerm": null, "latitude": 53.2809914, "description": "First letting of Four / Five Bedroom Family House at Boyd Avenue, Honeypark, Glenageary Road Upper.,***Unfurnished*** The houses in the development are traditional in character with a rich brick elevation. They are essentially classical contemporary in style, with the benefit of an abundance of light throughout, with higher ceilings than normal and an array of special features as standard. ,The house is divided between 3 floors. The ground floor consists of a large living room, WC, utility room and kitchen / family room which lead to the back garden. There are superb contemporary Oriel High Gloss and Wenge kitchen units with Beige Stardust Quartz worktop from Nolan Kitchens. On the first floor there are 2 large double bedrooms, a main bathroom and an entertainment room which can be easily used as an extra bedroom. On the top floor you have 2 large double bedrooms with an ensuite bathroom. The stylish bathrooms and en-suites are designed around contemporary clean lines to offer excellent quality throughout. There is high quality floor and wall tiling throughout. ,The gardens of Boyd Avenue offer an elegant extension of living space. Each garden comes complete and features a stylish patio directly off the living area which overlooks the fully landscaped garden. Gardens are finished with a garden house that is fitted with light and sockets, a service enclosure and a lockable rear access gate to the property. ,The Boyd Avenue houses must rank as the best new family homes to come on the market for a long time. They represent the incorporation of three decades of Cosgraves knowledge and experience of what is best in residential design. This is truly a flawless house with quite exceptional living and bedroom accommodation with a floor area extending to 207 sq.m / 2,228 sq.ft. The distinctive design with landscaped gardens, brick elevations and high ceilings in living areas is very impressive. Cosgraves have brought their own stamp and experience to the design by McCrossan O' Rourke Manning architects. ,The houses being built at Boyd Avenue have the advantage of being surrounded by three large parks and a meandering tree-lined woodland walkway which residents can enjoy. It is rare that a new development of houses is built in such a mature environmentally friendly setting and with all the benefits of being adjacent to all the amenities of Glenageary, Dalkey, Dun Laoghaire and Blackrock and within easy reach of the city centre by bus or DART.", "price": "3200 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/0/0/4/3395400/7c8cb037-64b1-4145-8490-512f907fe692_l.jpg", "http://photos-a.propertyimages.ie/media/0/0/4/3395400/a556497c-1e9b-4c99-a34c-6b9854990107_l.jpg", "http://photos-a.propertyimages.ie/media/0/0/4/3395400/72d97d6d-76d5-4347-b6ff-af6e0aede177_l.jpg", "http://photos-a.propertyimages.ie/media/0/0/4/3395400/ef90f18d-24b5-4cd5-a6db-3db2b022f625_l.jpg", "http://photos-a.propertyimages.ie/media/0/0/4/3395400/ff3fab14-a619-4de9-932f-fb49240bb17e_l.jpg", "http://photos-a.propertyimages.ie/media/0/0/4/3395400/0a5a10d1-6c43-46e2-8c55-2cf8a14cc4d3_l.jpg", "http://photos-a.propertyimages.ie/media/0/0/4/3395400/fba26ae3-916c-4311-80a0-88abec428295_l.jpg", "http://photos-a.propertyimages.ie/media/0/0/4/3395400/9f562307-617c-4f81-9c21-133215ec087c_l.jpg", "http://photos-a.propertyimages.ie/media/0/0/4/3395400/464261ad-60e7-4d7d-966b-e8f62921cfd7_l.jpg", "http://photos-a.propertyimages.ie/media/0/0/4/3395400/14e112e5-6097-4346-a97f-c2284cf88da8_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "Boyd Avenue, Honeypark, Dun Laoghaire", "shortLink": "www.myhome.ie/3395400", "url": "http://www.myhome.ie/rentals/brochure/boyd-avenue-honeypark-dun-laoghaire/339540