{"services_in_this_area": null, "ber_detail": ["BER Rating: BER D2", "BER Number: 108068511", "Energy Performance Indicator: 287.34"], "features": [], "agentFax": "01 278 4282", "negotiator": null, "agentName": "Sherry FitzGerald Lettings - Stillorgan", "property_type": "4 Bed To Let", "leaseTerm": null, "latitude": 53.3185023, "description": "Lovely light filled redbrick period house on Eglinton Road, one of Dublins most exclusive addresses. This exceptionally spacious four bed roomed semi detached family home enjoys an 80 ft long mature south facing garden. The house is approached by a gravelled landscaped front drive with parking for up to 3 cars, Entering through the stain glassed hall door to the roomy hall off which are two interconnecting reception rooms. The glass double doors between the high ceilinged rooms allow access from the front to the back and on out to the patio and garden through French doors. The open plan kitchen/breakfast room also opens on to the sunny patio and is equipped with a Siematic kitchen, granite topped island , and Miele appliances. Off the kitchen is a fully equipped utility room. Off the hallway is guest WC and separate office/study. Upstairs there are 2 double bedrooms, the master en suite with double shower and marble topped vanity unit, with two windows looking on to the tree lined road . The equally ample twin bedded room looks onto the garden. There are 2 large single rooms one looking over the garden and the other enjoys a street vista. The main bathroom has a double shower and bath. All the rooms are furnished in keeping with period of the house. Situated ideally at equal distance from the villages of Donnybrook and Ranelagh with all the great amenities they have to offer, including restaurants, cafes, sports grounds, tennis clubs, boutique shops, convenience stores and supermarkets. Herbert Park, the oldest park in Dublin, is a 10 minute walk down the road. At the top and bottom of the road, leading onto the QBC, there are