{"services_in_this_area": null, "ber_detail": ["BER: BER Exempt"], "features": ["* Beautifully Refurbished Georgian House", "* Exquisite Period Features", "* Prime Residential Location", "* Secure Off Street Parking For 2 Cars", "Furnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Microwave", "Cable TV", "Internet", "Alarm"], "agentFax": "01 6382706", "negotiator": null, "agentName": "Lisney Leeson Street", "property_type": "4 Bed Terraced House To Let", "leaseTerm": null, "latitude": 53.3354859076285, "description": ",Fitzwiliam Square, built in the late 18th. Century,was the last ofonly 5 Georgian Squares builtin Dublin. The centre of the square was closed off in 1813 and was used for social events by the residents of the Square.The same is true to-day andonly the property owners of the Squarehaveaccess to the gardens where they can enjoyit's peace and tranquillity.,This is a rareopportunity to savour the delight and convenience of living in one of only a few residential properties in the Square. This family home has been lovingly and meticulously restored, combining the wonderful period features with the conveniences of modern day living.,The location alone is exceptional which is within walking distance of shops, restaurants, theatres, schools, business sectors and transportation.,The accommodation comprises on the hall level, entrance hall, study, diningroom with carved doors.On the Hall Return, there isa butler's pantry with access to the rear garden. On the First Floor Return, a glazed atrium from the main house leads to the day room withceiling plaster work andhand painted walls depecting walled garden scenes . En suite with marble floors and walls.,The First Floor consists of 2 magnificent interconnectingreceptions with period fireplaces, and plaster ceilings,thefront room overlooks The Square, theback room overlooks the gardens. The Second Floor consists of the master bedroom suite, including walk-in closet, storage for lug