{"services_in_this_area": null, "ber_detail": null, "features": ["Furnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Microwave", "Cable TV", "Internet", "Alarm"], "agentFax": "01 6382706", "negotiator": null, "agentName": "Lisney Leeson Street", "property_type": "4 Bed Terraced House To Let", "leaseTerm": null, "latitude": 53.335245, "description": "Beautifully Refurbished Georgian House, Exquisite Period Features, Prime Residential Location, Secure Off Street Parking For 2 Cars,Fitzwiliam Square, built in the late 18th. Century, was the last of only 5 Georgian Squares built in Dublin.  The centre of the square was closed off in 1813 and was used for social events by the residents of the Square. The same is true to-day and only the property owners of the Square have access to the gardens where they can enjoy it's peace and tranquillity.,This is a rare opportunity to savour the delight and convenience of living in one of only a few residential properties in the Square.  This family home has been lovingly and meticulously restored, combining the wonderful period features with the conveniences of modern day living.,The location alone is exceptional which is within walking distance of shops, restaurants, theatres, schools, business sectors and transportation.,The accommodation comprises on the hall level, entrance hall, study, diningroom with carved doors. On the Hall Return, there is a butler's pantry with access to the rear garden. On the First Floor Return, a glazed atrium from the main house leads to the  day room with ceiling plaster work and hand painted walls depecting walled garden scenes .  En suite with marble floors and walls. ,The First Floor consists of 2 magnificent interconnecting receptions with period fireplaces, and plaster ceilings, the front room overlooks The Square, the back room overlooks the gardens. The Second Floor consists of the master bedroom suite, including walk-in closet, storage for luggage etc. and a wonderful bathroom, with bath and separate shower. The top floor comprises 3 double bedrooms, bathroom, and a fully fitted  kitchen. ,The garden level of the property consists of a spacious kitchen with beautiful  exposed brick and granite, gas fired Aga cooker,door leading to a heat controlled  wine cellar . There is a large conventional kitchen cum utility room off the main kitchen.  Lovely guest w.c. with hand painted walls and access to the rear landscaped garden. Plant Room. The basement has under floor heating and gas radiator heating throughout the rest of the property.There is off street parking for 2 cars.    LEASE....From 1 Year.", "price": "8750 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/2/6/9/3383962/2c63d6ee-c57d-41b6-8767-38d4fc0f15f2_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/9/3383962/db9cc9b8-eeac-45cb-8af2-0f5da1e74836_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/9/3383962/1b9e5e8f-2161-43da-93d2-a472b519f296_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/9/3383962/4f643e93-7aa7-4c55-849e-c2a9f2d9ca8d_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/9/3383962/caa8851f-497e-4a74-bc21-37c65f9cb371_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/9/3383962/ad79cf39-29f0-4c34-ac92-6e5b6a59fa24_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/9/3383962/883118b3-9394-4087-a60d-89e6421a73dd_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/9/3383962/d95501e0-392c-4a96-9e7b-5ab2db848c34_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/9/3383962/e95c135e-2abc-4b6f-97da-2a7659cd8eb5_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/9/3383962/b70982a6-a292-4325-a9c7-76efcd61ddef_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "Fitzwilliam Square, Dublin 2, Dublin South City, Dublin 2", "shortLink": "www.myhome.ie/3383962", "url": "http://www.myhome.ie/rentals/brochure/fitzwilliam-square-dublin-2-dublin-south-city-dublin-2/3383962", "longitude": -6.252195, "bed