{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "01-4966 445", "negotiator": null, "agentName": "Bracken Estates ", "property_type": "2 Bed Apartment To Let", "leaseTerm": null, "latitude": 53.3256213301612, "description": "Bracken Estates are pleased to present this very impressive second floor two bed apartment which extends to c. 66 sq metres / 710 sq. ft of exceptionally bright, well-proportioned accommodation. Located in this ever popular development in the centre of Rathmines, this accommodation comprises of a generous entrance hall with timber flooring, a storage closet and an intercom to the front door. The living room is an impressive space with a very bright aspect provided by double doors to the balcony which is overlooking Leinster Cricket Club. The fitted kitchen is located just off the living room. The two bedrooms house double beds with fitted wardrobes and carpet flooring with the master bedroom having an en-suite bathroom. The guest bathroom is well appointed with tiled walls and a tiled floor. The property is superbly located for you to enjoy all the convenience of city living. Within strolling distance of every conceivable amenity both social and essential that Rathmines has to offer including shops, bars, restaurants, third level education facilities along with many of Dublin's principle places of business.There is one secure underground car parking space. Coming from town, proceed over Portobello Bridge onto Lower Rathmines Road. At St Mary's College, continue straight on 300 metres and Rathmines Town Centre is on your left.            ,                                        BER Rating: C3                    ,BER Number: 107634594                                                ,                        ,", "price": "1750 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/5/6/8/3397865/eaa1dfa5-0ade-4bf7-ade0-3349b914265b_l.jpg", "http://photos-a.propertyimages.ie/media/5/6/8/3397865/c7510183-9769-4e