{"services_in_this_area": null, "ber_detail": null, "features": ["Unfurnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Cable TV", "Internet", "References Required"], "agentFax": null, "negotiator": null, "agentName": "McGovern Estates", "property_type": "4 Bed Detached 2500 ft / 232.26 m To Let  1 year lease", "leaseTerm": "1 year Lease", "latitude": 53.1457119, "description": "Truly spectacular detached family home, the likes of which is seldom offered on Wicklows rental market. Refurbished with great flair and impeccable taste to exacting standards, this remarkably elegant period residence provides 2500 sq.ft. (approx.) of stunning light filled and flexible accommodation in one of Wicklow most prominent locations.,Being exceptionally well designed and finished to a superior standard the property incorporates all modern amenities, with the additional benefit of retaining many of its original features. Bushfield offers spacious accommodation, which briefly consists of a large kitchen/dining area with inset fireplace providing an open fire in the kitchen / dining and the study / playroom, lounge with large sash windows allowing an abundance of natural light and feature open fireplace, living room also features an open fire and a large welcoming entrance hallway.  ,Upstairs there are 4 large double bedrooms with the master ensuite and family bathroom featuring a stunning free standing Victorian bath. ,This is an extremely private home which boasts off-street parking and is approached by electric gates and a gravelled entrance.  The property is over-looking private landscaped gardens featuring a patio area, mature plants, trees and shrubbery.,This fine property is surpassed by no other and with an exceptionally convenient location, only minutes from the N11; it provides effortless commuter access to Bray, Cherrywood & Dublin city centre.  Viewing of Bushfield is highly recommended. ,Special Features (Interior), ,Zoned heating system including under floor heating to Ground Floor and column type radiators to First Floor.,All original exterior walls have been insulated using a breathable dry lining system.,Handmade internal panelled doors, architraves and skirtings.,Hand painted traditional kitchen with granite tops and modern A rated fittings.,Traditional black and white tile (chess board pattern) to entrance hall.,Traditional decorated Bathrooms / Ensuites with a mix of painted wall timber panelling / tiled wall finish and floor finishes.,Main Bathroom includes both a traditional free standing bath and corner shower with low profile tray and power shower.,Original re-installed / refurbished timber floors to the First Floor.,Plaster cornicing to all rooms.,Newly insulated Attic.,Internal ceiling speakers installed to all rooms to Ground Floor and the Master Bedroom at First Floor.,Security system installed throughout the renovated / extended house.,Exterior, ,Electric gates to front parking area.,Parking for two large cars / suvs provided.,Private landscaped South East facing rear garden.,Refurbished existing timber up & down sash windows with newly installed draft stripping and cords.,Exterior boiler house containing boiler / water tanks and water pump.,Exterior storage shed.,Bushfield House is located on Church Road in the heart of Greystones Town, an ever expanding retail and commercial location. The existing dwelling is located on the main thoroughfare of Greystones  just before the well renowned Happy Pear restaurant with a steady footfall passing by at all times. Situated in one of the most sought after and prestigious locations in north Wicklow. This ever expanding coastal town is now the second largest town in the county with an ever growing population of c.17,000. The location of this property is second to none with every conceivable amenity close by. The picturesque coastal town of Greystones is on your doorstep, where the quality of village life meets the conveniences of modern living.,E