{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "01 6766340", "negotiator": null, "agentName": "Hooke & MacDonald", "property_type": "2 Bed Apartment To Let", "leaseTerm": null, "latitude": 53.354224, "description": "Hooke and MacDonald are proud to present this beautiful 2 bedroom property in excellent condition.,Accommodation briefly comprises large living room with kitchen / dining area. Two Double Bedrooms (master ensuite), hot-press / storage and a main bathroom.,Situated just minutes from the Liffey Valley Centre this stylish apartment will suit professionals as well as families. The property comes fully furnished to a very high standard, utilising light and space. All the fixtures and fittings are modern, contemporary and of excellent quality. ,St. Edmunds is beautifully landscaped and well maintained whilst also being very secure and a popular living destination. St Edmunds is located moments from the junction of the M50 and N4, providing quick and easy access to locations around Dublin and beyond. The city centre is approximatly 9km away and airport accessible along the M50. Buses depart to and from the city centre approximately every five minutes, and are given priority during rush hour along the routes extensive bus corridors. Buses connect with Heustons Station, allowing further connections with the LUAS red line or local and national train services.,The Liffey Valley area is transforming into an exciting hub for young professionals with the recent development of new hotels and bars, Dublin's premier health and fitness centres, and the country's landmark shopping and entertainment experience, the Liffey Valley Shopping Centre. Modern business parks are also on the rise, with many companies choosing the area as a smart new address within easy reach of the city centre. Viewing highly recommended to truly appreciate St Edmunds, the location and the apartment. ,Please note the photos are not specific to this apartment but fini