{"services_in_this_area": null, "ber_detail": null, "features": ["Furnished", "Parking", "Central Heating", "Washing Machine", "Cable TV", "Alarm"], "agentFax": "01 286 1643", "negotiator": null, "agentName": "H J Byrne", "property_type": "2 Bed Apartment 87 m / 936 ft To Let", "leaseTerm": null, "latitude": 53.2013991, "description": "Truly stunning 2 bed apartment available to let.  Situated in a prime residential location in this most attractive mature area of old Bray, Sidmonton Place is half way between Brays main street and the sea, and is thus within five minutes walk of the town centre and all its services, the seafront and promenade and a choice of public transport at the nearby dart and various bus routes. Toner House is a very attractive imposing late 19th Century building.  An extensive conversion in the past gave this very impressive building a new lease of life.  Its Venetian gothic styling and red brick facing with stepped granite approach, emphasise that this is a building of distinction.  This spacious apartment boasts many features including a wonderful living room drenched in natural light from the bay window plus most attractive feature fireplace, archway leads to a fully fitted modern kitchen, the apartment also has two good sized double bedrooms (5.31 x 3.81m and 3.01 x 3.81m) both with built-in wardrobes and the master featuring an ensuite, further shower room accessed off the hallway plus hotpress.  The property also has the benefit of gas fired central heating, alarm system, tv and television points plus intercom system.  Number 8 is being let furnished and is available from the 1st of December, 2015.  Rent: 1,300 per month.", "price": "1300 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/1/8/7/3404781/bd3ce612-e8fb-4f2d-a5f0-1462123b86d2_l.jpg", "http://photos-a.propertyimages.ie/media/1/8/7/3404781/72ccd405-b5b8-402c-aaf4-e8276bf6202e_l.jpg", "http://photos-a.propertyimages.ie/media/1/8/7/3404781/89daac7e-9c75-435d-9682-9