{"services_in_this_area": null, "ber_detail": null, "features": ["* House Alarm", "* 3 Double Beds", "* Energy Rating: E2", "* Fully Furnished", "* Communal Parking", "* Storage Heating", "* Balcony"], "agentFax": null, "negotiator": null, "agentName": "Wyse Estate Agents", "property_type": "3 Bed Apartment To Let", "leaseTerm": null, "latitude": 53.30364, "description": "Wyse are proud  to present this fine two storey semi detached three bedroomed townhouse in an enviable position in the immaculately presented Westfield/Sion Hill Estate situated opposite Blackrock Park. The property overlooks the manicured estate gardens to the front and the treelined convent to the back. The townhouse has been tastefully decorated and furnished to complement the original attractive neo Georgian design.The accommodation, in brief, consists three double bedrooms with the master ensuite upstairs and downstairs a kitchen and generous living/dining room leading to a west facing private balcony.  No. 47 is accessed by handsome exterior steps to an own door entrance thar opens to an attractive hall.  The kitchen is a galley style with room for breakfast dining overlooking the common gardens. The dining/living room is bright and spacious boasting a private balcony facing west facing the trees that surround the Sion Hill convent. The upstairs accommodation includes three good size double bedrooms, with master ensuite, main bathroom with full suite, built in wardrobe space. The property also includes secure off street communal parking and a useful storage space under the entrance, ideal for bicycle storage. Presented in stunning condition throughout viewing is a must Location is second to none, The thriving village of Blackrock is a two minute walk away with it''s superb selection of cafes, boutiques, specialist shops, Blackrock Shopping Centre, bars and restaurants. An array of junior, senior and third level schools and colleges are within easy reach including Sion Hill Froebel College, The Smurfit Business School and UCD. Blackrock, St Andrew''s and St. Michael''s Colleges are very accessible and the Blackrock Clinic is five minutes away. The property is well serviced by public transport - the Rock Road QBC and the DART within a short stroll offer easy access to the City Centre, Trinity College, and Dublin''s many other amenities and attractions.", "price": "2000 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/2/6/6/3404662/8fe19ed8-05fe-4469-b6c9-5b332c6393e8_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/6/3404662/91b12b32-cacb-4034-b902-e9f8b6c412fc_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/6/3404662/474e6333-2c05-4825-b131-36e78b7a0f9e_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/6/3404662/42edff1d-29b5-4910-b4f2-a07705cb9d6b_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/6/3404662/6168288b-ea0a-4ed4-8a36-461b58124767_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/6/3404662/8316af33-9b4e-40aa-9879-9005d8a63722_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/6/3404662/e3da3b3b-1919-48bf-ba26-8c1201afb71d_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/6/3404662/9fa3e4f7-647d-492c-84bd-5285a123b666_l.jpg", "http://photos-a.propertyimages.ie/media/2/6/6/3404662/50f2f459-9976-4ada-956c-c86f50e54598_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "Westfield, Sion Hill, Blackrock, Co. Dublin", "shortLink": "www.myhome.ie/3404662", "url": "http://www.myhome.ie/rentals/brochure/westfield-sion-hill-blackrock-co-dublin/3404662", "longitude": -6.18586, "beds": 3, "agentPhone": "01 6470600", "deposit": null, "ber": "E2", "agentAddress": "94 Lower Baggot Street, Dublin City Centre, Dublin 2 ", "addedOnDate": "Added 7 days ago, refreshed 7 days ago"}
{"services_in_this_area": null, "ber_detail": ["BER:", "BER No. XXX", "Energy Performance Indicator: XXX kWh/m/yr"], "features": [], "agentFax": null, "negotiator": "Negotiator: Nick Crawford BA BSc AsscSCSI", "agentName": "Crawford's", "property_type": "6 Bed Country House To Let", "leaseTerm": null, "latitude": 53.1087032, "description": "Luggala Lodge was built in 1787 and Gothicised thereafter for the La Touche family (Dublin bankers of Huguenot origin). In 1937, Ernest Guinness bought Luggala and gave it as a wedding present to his daughter, Oonagh Guinness, on her marriage to Lord Oranmore and Browne. Oonagh 'imbued Luggala with enchantment' and made it 'the most decorative honeypot in Ireland.',Nobody could stay away: Dublin intelligentsia, literati. painters, actors, scholars, hangers-on, toffs, punters, poets, and social hang-gliders. Luggala famously became the gathering place for Dublins intelligentsia, as well as artists and musicians from around the world.,The exquisite Gothic Revival house is set against the backdrop of the beautiful Wicklow Mountains. The gates are now open to welcome discerning guests in search of a unique holiday experience.,\"[Luggala] has turned out to be our inspiration.\", Bono, U2, \"It isnt so much an estate as a kingdom, a veritable Middle Earth of heather-covered-mountains, silvery waterfalls and lakes, emerald forests and meadows.\",- W Magazine,The breath taking demesne has been used as a location for films such as Zardoz (1974), starring Sean Connery and Charlotte Rampling; Excalibur (1981), featuring Nigel Terry and Helen Mirren; The Nephew (1998), directed by Pierce Brosnon; King Arthur (2004), with Clive Owen and Keira Knightley; and Astrix et Oblix (2012), with Grard Depardieu.,The staff, amenities and chauffeur service (with a 1952 Rolls-Royce Silver Wraith limousine that was built by Hooper to the design of Osmond Rivers) are included with the reservation., Luggala Lodge offers a chef, who specializes in traditional Irish and international cuisines. Guests are invited to stay on a bed and breakfast or fully catered basis. For those who need to combine business with pleasure, there is a full office and conferencing facility., Traditional Irish singers and musicians are also available upon request. ,Experience the hospitality enjoyed by royalty, inspired musicians, poets and artists.", "price": "20000 / week", "image_urls": ["http://photos-a.propertyimages.ie/media/6/8/6/2123686/3c2386f4-1a22-4d28-b860-b54bc538ad71_l.jpeg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/de992143-213f-4fcb-8616-469eae66fd4d_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/c7f4b9bb-0831-45df-aa9f-cbcac41b8cf6_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/94ca2ddc-aca4-4178-976f-0777aba0ed10_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/353_l.JPG", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/163ebafc-168e-40da-a74e-06848b476d38_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/e1727c57-0b17-4c81-9fc2-aa2c6c4ca53d_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/cd6ddd5d-ec38-421f-947b-55f8b3f4e872_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/2b9a4c4b-73d9-47f5-a8e3-6f9f494e8c91_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/ac243361-e5aa-44c3-a76b-12c717fc12d2_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/b6112c2d-45cd-41c1-9d11-25bf5f5c0d2f_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/333_l.JPG", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/301d5008-1799-430f-9990-f69c3baca8f8_l.jpg", "http://photos-a.propertyimages.ie/media/6/8/6/2123686/1761fa64-0db6-48b9-9880-f8c60064fb56_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": "001515", "address": "Luggala, Roundwood, Co. Wicklow.", "shortLink": "www.myhome.ie/2123686", "url": "http://www.myhome.ie/rentals/brochure/luggala-roundwood-co-wicklow/2123686", "longitude":