{"services_in_this_area": null, "ber_detail": null, "features": ["Furnished", "Unfurnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Cable TV", "Alarm", "Suits Students", "Suits Professionals", "References Required", "Pets Allowed"], "agentFax": "01-4966 445", "negotiator": null, "agentName": "Bracken Estates ", "property_type": "5 Bed Detached 183 m / 1970 ft To Let", "leaseTerm": null, "latitude": 53.2770215, "description": "Bracken Estates is delighted to present to the market 87 Kill Lane, a  detached family home close to Foxrock Church. The property extends  183sq.m./1,969sq.ft.,Accommodation comprises of an entrance porch, a lovely hallway, living room with inter connecting door through to the dining room, guest W.C., study, waiting room, separate side entrance door, kitchen, and utility. Upstairs there are four bedrooms, three of which are fine sized double bedrooms, a bathroom and there are two additional rooms which are currently being used as bedrooms. ,The front garden is nicely shielded from the road with mature trees and the property is accessed via dual entrances with ample off street parking for at least six cars. There is vehicular access to the detached garage and also into the rear garden. The rear gardens offers immense privacy as it is not directly overlooked and measures  over 110ft in length. ,Accommodation:,Entrance Porch ,Entrance Hall  Bright and spacious, featuring pitch pine floors, 9ft ceilings, decorative coving and a guest W.C. Living Room  Expansive layout, large picture frame windows  flood the room with natural light, featuring pitch pine floors, 9ft ceilings, decorative coving, a tile surround open fireplace, television point, inter connecting folding door through to the dining room. There is also direct access to the rear garden.,Dining Room  Perfect for entertaining, featuring pitch pine floors, 9ft ceilings and decorative coving. This room too is wonderfully bright and spacious.,Kitchen  Is in nee