{"services_in_this_area": null, "ber_detail": null, "features": ["Furnished", "Unfurnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Microwave", "Cable TV", "Alarm"], "agentFax": "01 289 8485", "negotiator": "Negotiator: Caroline McArdle", "agentName": "Hunters Estate Agent", "property_type": "3 Bed SemiDetached 118.16 m / 1272 ft To Let", "leaseTerm": null, "latitude": 53.3350248, "description": "Hunters are delighted to bring to the letting market this Victorian period Villa style semi which benefits from magnificent views. The House benefited from the owners unique style and design the duo of a design engineer and an interior designer, conspired to offer you a technologically current smart home with flair. The living space in this house is upstairs, maximizing the panoramic views of Dublin Bay and Howth. Some people call the Villa Style house, an upside down house! ,Accommodation ,The hallway welcomes you with a beautiful hand crafted wenge woodblock floor that the owners designed, which has recently been re-sanded and sealed. ,The Living room continues to enchant you with its floating polished plaster wall and wenge floor. A Lotus wood burning stove creates with the dual aspect view gives a great sense of light and space in this room, creating a positive, flexible environment,All the rooms have retained the shutters on the windows, in keeping with the style and time period of the house, while offering the opportunity to close off the house when needed.,The Kitchen offers effective storage without dominating the room and truly imbues the concept of the kitchen being at the heart of the house. ,The kitchen units are minimalist white gloss doors with stainless steel nickel handles. The worktop is wenge, which compliments the wenge floor.  Miele cooker, dishwasher and microwave add to this luxurious kitchen room with a view.  The ebony oval table affords intimate dining within the heart of the house. ,The master suite is a wonderful retreat. With a walk in wardrobe room of Italian dark glass doors hiding an array of storage and shelving solutions for any keen fashionista! ,The guest bedroom is perfect for guests or children and has TV point, data and scene dimming which is ideal for guests, kids or teenagers to enjoy and relax in their own space.,Huber cool Attics, well this definitely ticks all the boxes! If you want the coolest room, with your own rear projector to watch movies or sports, or just hang out with your friends, well this attic space is for you. Over 300 square feet of coolness, this makes a great guest, or teenager or private movie room. With its own luxurious ensuite, vaulted ceiling and electronic blackout blinds, there are other hidden treasures here too,The Bathrooms have been luxuriously cladded in Crema Marfil, floor to ceiling, with large shower enclosures of glass doors and panels.  Enjoy Grohe double rain shower heads that will soothe you as cleanse. Philippe Starck units graces the bathroom and ensuite.  The Philippe Starck pedestal sink is particularly elegant in the main bathroom.,The heating system is gas powered, but all hidden in the garage at the end of the garden. So no irritating pump noises or opportunities for nasty leaks, this takes all the mechanical apparatus out of the house and maximizes storage capacity inside the house. You see, I did say, it was subtly designed! The heating is a combination of underfloor in the basement and radiant heat from designer Jaga radiators. This offers both ambient and radiant heat, making the house very snug indeed. There are solar panels on the garage roof, which dumps heat into a buffer in the plant room located beside the garage. This means that you are heating from a warmer base and will reduce costs for hot water, most especially in the summer months.,There are electric gates at the front of the house, with 3 m high gates at the side of the house. These are opened via an electronic fob. There are four cameras, which offer CCTV footage that is recorded and retained for one month. Access to the live or recorded footage is available via an app on your phone or iPad. So any concerns if you are away or you want to monitor the property can be accessed simply via the security app.,An oasis of calm and privacy, the garden extends to 62 meters long, a rarity in a city location. Planted with Bamboo trees, silver birch and exotic palm trees, this garden has an extensive outdoor dining area, with ample seating, climbing frame for kids and plenty of lawn space. The garden aspect is westerly, so the garden has the benefit of glorious sunshine all day into late evening. ,Sandymount Village,A quintessential village with a green, sandymount village embodies city living but with a friendly community spirit. For families, the village green offers a haven to hang out and meet friends or for professionals, Browns for breakfast on a Saturday morning.  Sandymount village appeals to all ages and age groups. From Pubs, to coffee shops to dining, there is something for everyone here and sandymount welcomes families, professional couples and the elderly. A true sense of community, and with a keen sporting pedigree, the Aviva stadium nearby, you will often see the supporters of Boys in Blue (Leinster Rugby) frequenting the Pubs and restaurants on match days! Whether you are a keen supporter or bi-stander, the village comes alive on match days, with kids and adults alike soaking up the atmosphere.", "price": "5500 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/1/2/7/3405721/32c8a1b7-3e3a-42e9-992d-a3d8b53bec6d_l.jpg", "http://photos-a.propertyimages.ie/media/1/2/7/3405721/1cf3bb9c-d250-46d6-9b31-46af15dd0a53_l.jpg", "http://photos-a.propertyimages.ie/media/1/2/7/3405721/8a34f193-7bac-467a-9a42-5f63b3268b3e_l.jpg", "http://photos-a.propertyimages.ie/media/1/2/7/3405721/132df71b-e1bd-4138-a827-fe07a9755a8f_l.jpg", "http://photos-a.propertyimages.ie/media/1/2/7/3405721/937f21ea-1ea5-47b6-8aaa-b