{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "01-4966 445", "negotiator": null, "agentName": "Bracken Estates ", "property_type": "5 Bed To Let", "leaseTerm": null, "latitude": 53.2770215, "description": "Bracken Estates is delighted to present to the market 87 Kill Lane, a  detached family home close to Foxrock Church. The property extends  183sq.m./1,969sq.ft.,Accommodation comprises of an entrance porch, a lovely hallway, living room with inter connecting door through to the dining room, guest W.C., study, waiting room, separate side entrance door, kitchen, and utility. Upstairs there are four bedrooms, three of which are fine sized double bedrooms, a bathroom and there are two additional rooms which are currently being used as bedrooms. ,The front garden is nicely shielded from the road with mature trees and the property is accessed via dual entrances with ample off street parking for at least six cars. There is vehicular access to the detached garage and also into the rear garden. The rear gardens offers immense privacy as it is not directly overlooked and measures  over 110ft in length. ,Accommodation:,Entrance Porch -,Entrance Hall - Bright and spacious, featuring pitch pine floors, 9ft ceilings, decorative coving and a guest W.C. Living Room - Expansive layout, large picture frame windows  flood the room with natural light, featuring pitch pine floors, 9ft ceilings, decorative coving, a tile surround open fireplace, television point, inter connecting folding door through to the dining room. There is also direct access to the rear garden.,Dining Room - Perfect for entertaining, featuring pitch pine floors, 9ft ceilings and decorative coving. This room too is wonderfully bright and spacious.,Kitchen - Is in need of upgrading, it features ample floor to eye level fitted units, lino flooring, it is plumbed for a dish- washer and there is direct access to the utility.,Utility - Spacious utility room, it features a sink unit and ample storage presses, it is plumbed for a washing machine and there is direct access to the rear.,Surgery Room - Was previously used as a surgery but could now be utilised as a home office or play room. Features pitch pine flooring and sink unit.,Waiting Room - Was previously used as a waiting room but again there is plenty of potential to open up the two rooms and use them as a third reception room. This  room features pitch pine flooring.,      ,Bedroom 1 - The main bedroom is very generous in size, it features fitted wardrobes and  is  carpeted,Bedroom 2 - The second bedroom is another fine sized double, it is carpeted and features a built in sink unit.,Bedroom 3 - A double bedroom, it is carpeted and features ample built in wardrobes and a vanity unit.,Bedroom 4 - Roomy single bedroom featuring fitted ward robes, carpeted flooring and sink unit.,Bathroom - Comprising bath, separate shower, bidet, W.C., W.H.B., built in mirror and shelving.,Room 5 - Is currently being used as a bedroom, it features ample eaves storage, fully wood panelled walls and carpeted flooring.,Room 6 - Features fully wood panelled walls, carpeted flooring and ample eaves storage.,Kill Lane is a highly regarded residential area of quality and unique family homes convenient to all conceivable amenities. There are a host of amenities within the immediate area including some of Dublin's finest schools, several shops - including Lidl which is just a short walking distance away, Cornelscourt shopping centre, leisure facilities and excellent transport links including the QBC, the LUAS and M50. All in all, number 87 is a one of a kind property in a highly desirable location.            ,                                        BER Rating: G                                            ,                        ,", "price": "2000 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/7/8/7/3405787/e76c33ec-e109-47c5-962a-1ad01fc8e6c1_l.jpg", "http://photos-a.propertyimages.ie/media/7/8/7/34