{"services_in_this_area": null, "ber_detail": ["BER Rating: BER D2", "BER Number: 100544386", "Energy Performance Indicator: 276.55"], "features": [], "agentFax": null, "negotiator": null, "agentName": "Sherry FitzGerald Lettings - City Centre", "property_type": "4 Bed To Let", "leaseTerm": null, "latitude": 53.315402, "description": "Sherry FitzGerald Lettings are proud to introduce 72 Brighton Square to the market. A handsome and beautifully appointed unfurnished four bedroom semi-detached Victorian home, perfectly positioned on this quiet picturesque square just a gentle stroll from both Rathgar and Terenure Villages. The atmosphere within is welcoming, a testament to the lovely family home created by the current owners. Behind the attractive red brick faade lies a wealth of luxurious accommodation, full of charm and character.,This family home (which underwent extensive renovation and refurbishment in 2007) combines the best of period elegance and modern living, with a high quality finish and exceptional attention to detail throughout. A granite pathway leads to a wonderful arched hallway with detailed plasterwork. Two elegantly appointed interconnecting reception rooms are located off the hallway with exceptional period detail and two matching Carrara marble and slate fireplaces. To the rear of the ground floor, there is a modern kitchen, which has been fitted with high gloss cream units and Neff appliances. A fully fitted utility room is located to the rear of the property. On the return, there is a bright, fully tiled bathroom and bedroom/study that features an original cast iron fireplace. The first floor comprises three further bedrooms, all double with original period detailing in including sash windows. The property has been further enhance by many modern features such as a new central heating system that was installed in 2008, Bisque designer radiators and a multi-function touch sensitive Lutron lighting and video system. The property has also been fully damp proofed and re-plastered.,A most notable feature of this stunning home is the sun drenched 175 ft. south facing rear garden which has been partially landscaped. Well stocked, it features mature fruit trees including damson and apple trees. This exceptional outside space provides the prospective purchaser with the opportunity to further extend the already impressive accommodation. The current owners previously received planning permission to create an impressive and contemporary architecturally designed extension (105 sq.m. approx.) as well as a separate detached garden room (22 sq.m. approx.). The front garden is charming, and contains three Tasmanian man fern trees and box hedging.,The location is first class - situated between the villages of Rathgar and Terenure with every amenity on your doorstep to include bus routes, local shopping, bars and restaurants as well as being a 30 min walk to St. Stephen''s Green and ease of access to the major national transport routes. Some of Dublin''s best junior and senior schools are close by including St Joseph''s Boys'' National School, Rathgar Junior School, Terenure College, Stratford College, The High School, Alexandra College, St Mary''s College and Gonzaga College to name but a few. The renaissance of Dartry, Rathgar and Terenure provides a choice of trendy restaurants and local shops. Whilst Sports clubs nearby include Brookfield Tennis Club, LA Fitness, Leinster Cricket Club and Rathmines swimming pool. Exclusive to the owners in Brighton Square is the private square itself with its pavilion and three tennis courts.", "price": "3500 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/0/7/3/3408370/e496115d-1671-480f-9d03-33a720a5b3d3_l.jpg", "http://photos-a.propertyimages.ie/media/0/7/3/3408370/b1d34952-f68b-4e7a-8b51-775708f807e4_l.jpg", "http://photos-a.propertyimages.ie/media/0/7/3/3408370/1676d181-27e4-4493-a870-c8f83eb2db1d_l.jpg", "http://photos-a.propertyimages.ie/media/0/7/3/3408370/023042