{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "01 6766340", "negotiator": null, "agentName": "Hooke & MacDonald", "property_type": "5 Bed SemiDetached To Let", "leaseTerm": null, "latitude": 53.2943789137758, "description": "First letting of Four / Five Bedroom Family House at Brickfield, Honeypark, Glenageary Road Upper.,***Unfurnished*** The houses in the development are traditional in character with a rich brick elevation. They are essentially classical contemporary in style, with the benefit of an abundance of light throughout, with higher ceilings than normal and an array of special features as standard. ,The house is divided between 3 floors. The ground floor consists of a large living room, WC, utility room and kitchen / family room which lead to the back garden. There are superb contemporary Oriel High Gloss and Wenge kitchen units with Beige Stardust Quartz worktop from Nolan Kitchens. On the first floor there are 2 large double bedrooms, a main bathroom and an entertainment room which can be easily used as an extra bedroom. On the top floor you have 2 large double bedrooms with an ensuite bathroom. The stylish bathrooms and en-suites are designed around contemporary clean lines to offer excellent quality throughout. There is high quality floor and wall tiling throughout. ,The gardens of Brickfield offer an elegant extension of living space. Each garden comes complete and features a stylish patio directly off the living area which overlooks the fully landscaped garden. Gardens are finished with a garden house that is fitted with light and sockets, a service enclosure and a lockable rear access gate to the property. ,The Brickfield houses must rank as the best new family homes to come on the market for a long time. They represent the incorporation of three decades of Cosgraves knowledge and experience of what is best in residential design. This is truly a flawless house with quite exceptional living and bedroom accommodation with a floor area extending to 207 sq.m / 2,228 sq.ft. The distinctive design with landscaped gardens, brick elevations and high ceilings in living areas is very impressive. Cosgraves have brought their own stamp and experience to the design by McCrossan O' Rourke Manning architects. ,The houses being built at Brickfield have the advantage of being surrounded by three large parks and a meandering tree-lined woodland walkway which residents can enjoy. It is rare that a new development of houses is built in such a mature environmentally friendly setting and with all the benefits of being adjacent to all the amenities of Glenageary, Dalkey, Dun Laoghaire and Blackrock and within easy reach of the city centre by bus or DART.", "price": "3200 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/4/1/6/3382614/77840b30-d649-4c52-9f56-4f60c7cc3029_l.jpg", "http://photos-a.propertyimages.ie/media/4/1/6/3382614/102e63cf-81ea-4101-a205-d2f3be2bfc7a_l.jpg", "http://photos-a.propertyimages.ie/media/4/1/6/3382614/4f2ff983-bd29-4424-ab38-da04701caf26_l.jpg", "http://photos-a.propertyimages.ie/media/4/1/6/3382614/113fd737-f763-4800-a19a-1a1afe0e913c_l.jpg", "http://photos-a.propertyimages.ie/media/4/1/6/3382614/014fad45-00fe-4bdc-8661-a8a8718e6b14_l.jpg", "http://photos-a.propertyimages.ie/media/4/1/6/3382614/4372a89c-52f7-403a-9e89-762edfd89241_l.jpg", "http://photos-a.propertyimages.ie/media/4/1/6/3382614/6c2c26e3-63ca-4682-9344-14b12897b17c_l.jpg", "http://photos-a.propertyimages.ie/media/4/1/6/3382614/5280882a-7857-4cc8-a566-af3f982ded4a_l.jpg", "http://photos-a.propertyimages.ie/media/4/1/6/3382614/e30b69d7-ceb2-4800-9dc9-0b6d3fcb0b9c_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "Brickfield, Honeypark, Glenageary Road Upper, Dun Laoghaire", "shortLink": "www.myhome.ie/3382614", "url": "http://www.myhome.ie/rentals/brochure/brickfield-honeypark-glenageary-road-upper-dun-laoghaire/3382614", "longitude": -6.13420964594116, "beds"