{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "01 6766340", "negotiator": null, "agentName": "Hooke & MacDonald", "property_type": "3 Bed Apartment To Let", "leaseTerm": null, "latitude": 53.354224, "description": "Stylish 3 bedroom apartment located in the beautifully maintained St Edmund's Park. Situated just minutes from the Liffey Valley Centre this stylish apartment will suit professionals as well as families. The property comes fully furnished to a very high standard, utilising the light and space as this property is exceptionally large. The apartment comprises open plan living/kitchen/dining, with three double bedrooms, livingroom, master en-suite and family bathroom. All the fixtures and fittings are modern, contemporary and excellent quality. St Edmund's is beautifully landscaped and well maintained. ,St Edmund's is very secure and a popular living destination. St Edmund's is located moments from the junction of the M50 and N4, providing quick and easy access to locations around Dublin and beyond. The city centre is approximately 9km away and airport accessible along the M50. Buses depart to and from the city centre approximately every five minutes, and are given priority during rush hour along the routes extensive bus corridors. Buses connect with Heustons Station, allowing further connections with the LUAS red line or local and national train services. ,The Liffey Valley area is transforming into an exciting hub for young professionals with the recent development of new hotels and bars, Dublin's premier health and fitness centres, and the country' s landmark shopping and entertainment experience, the Liffey Valley Shopping Centre. Modern business parks are also on the rise, with many companies choosing the area as a smart new address within easy reach of the city centre. Viewing highly recommended to truly appreciate St Edmund's, the location and the apartment. Please note the photos are not specific to this apartment but finished to similar standard. Actual photos to follow. Work References Essential.,Features:,New flooring throughout,New furniture,New blinds,Repainted throughout", "price": "1600 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/3/2/3/3383323/79d5d705-b253-4e40-9dca-71b04897fa31_l.jpg", "http://photos-a.propertyimages.ie/media/3/2/3/3383323/f0095363-3d96-45e1-8e5e-cdcb33ed4a95_l.jpg", "http://photos-a.propertyimages.ie/media/3/2/3/3383323/71d4cf5a-52bf-40fd-b258-cc8cec635ffd_l.jpg", "http://photos-a.propertyimages.ie/media/3/2/3/3383323/afcaaf96-ecfb-4da7-a10d-ba95191cd0ac_l.jpg", "http://photos-a.propertyimages.ie/media/3/2/3/3383323/54cf4ecc-df57-40d3-886e-ac1faf82d7d5_l.jpg", "http://photos-a.propertyimages.ie/media/3/2/3/3383323/2ab65dbc-dd3b-4393-96d0-07bd845448b8_l.jpg", "http://photos-a.propertyimages.ie/media/3/2/3/3383323/a4c698b4-054c-4622-9bf5-39490979753e_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "Juliet Square, St Edmunds, Palmerstown", "shortLink": "www.myhome.ie/3383323", "url": "http://www.myhome.ie/rentals/brochure/juliet-square-st-edmunds-palmerstown/3383323", "longitude": -6.40788250000003, "beds": 3, "agentPhone": "01 6318402", "deposit": null, "ber": null, "agentAddress": "118 Lower Baggot Street, Dublin City Centre, Dublin 2, ", "addedOnDate": "Added 3 weeks ago, refreshed 3 weeks ago"}
