{"services_in_this_area": null, "ber_detail": ["BER: C3", "BER No. 107889362", "Energy Performance Indicator: 217.61"], "features": ["Furnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Microwave", "Cable TV", "Internet", "Alarm", "Suits Professionals", "References Required", "Walk-in Shower"], "agentFax": null, "negotiator": "Negotiator: Thom Burke-Kennedy", "agentName": "BK Earley", "property_type": "6 Bed Detached 372 m / 4004 ft To Let", "leaseTerm": null, "latitude": 53.2695935, "description": "Set in 3 acres of private Woodland in a spectacular & private Location with magnificent panoramic Sea Views, minutes walk from Dalkey Village, Beaches & Parks, this is a recently renovated modern Fully Furnished & Equipped 6 Bedroom 4 Bathroom comfortable family Home of approx. 4000sqft/372m2 internal Living Area, with spacious furnished Decks & Balconies, direct access to Killiney Hill Park, multiple space Off Road Parking & Double Garage. ,This house is set on the side of Killiney Hill, facing Killiney Bay, with a shared [with 1 other property only] private road access through woodland.,Accommodation Description:,This house is approached by steps leading to the Hall Door.,Ground Floor:,Through the Hall Door into a Hallway with a Cloakroom immediately to the left, & to the right a Single Bedroom/Office; off the Hall to the right is the 1st Double Bedroom with an ensuite Shower Room [+ WC & Hand Basin] with doors leading onto a Patio, again off the Hall & with magnificent Sea Views is the large & spacious Master Bedroom with built in Wardrobes & full ensuite Bathroom, the Master Bedroom opens onto a private Patio; off the same Hall is a Laundry Room, a separate Utility/Services Room & a Shower Room [+ WC & Hand Basin]; at the end of the Hall is a 2nd Double Bedroom with doors leading onto a private Patio.,First Floor,The First Floor is reached by stairs from the Ground Floor Hall.,On reaching the top of the short flight of stairs you ente