ut ,Private rear Garden,Prvate ground level rear gravelled Patio,Ground Floor:,Entrance Porch,Hall ,Double Bedroom 2 (4.26 x 2.91m) ,En suite Shower room (2.07 x 1.72m),Single Bedroom/Office/Utility 3 (4.19 x 3.57m) ,Double Bedroom 4 (1.94 x 2.8m) ,Family Bathroom (2.17 x 3.76m) ,Utility/Laundry,First Floor:,Living/Dining Room (3.23 x 8.41m) ,Fitted & Fully Equipped Kitchen/Drawing Room (4.27 x 6.8m) ,Store/Utility Room ,Sun Terrace/Deck,Second Floor:,Sitting Room (4.67 x 4.59m) ,Master Bedroom (4.10 x 4.42m) ,En suite (2.31 x 2.09m),Sun Terrace/Deck,Outside:,To the front of Bayview is private off road parking. ,On the upper levels are spacious decked sun terraces with exceptional sea views, this house is a sun & light trap! ,To the rear is a private garden in lawn, surrounded by hedging.,Asking Rent 6000 @ month,BER: D1,BER No. 107034597,Energy Performance Indicator: 234.52 kWh/m2/yr,Viewing only By Appointment with:,Thom Burke-Kennedy @ BK Earley PSR 001849,0877942119,tbk@bkearley.com", "price": "6000 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/9/1/8/3288819/10b98a2e-23e8-46c2-8d44-85fec0a5db36_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/8/3288819/b00d3216-be2d-4ad7-a9af-62c4fb29ac5a_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/8/3288819/2f006e1c-40a1-4057-b2a0-5e86e0dde855_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/8/3288819/06e117a5-9d60-41a3-9919-71621f2eed34_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/8/3288819/e0ef9d74-0603-41b5-b94d-a96f9b5f0806_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/8/3288819/193c27f2-a85b-4ca0-9624-26fe12f37103_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/8/3288819/c97183e2-6bf2-4260-83f9-c3a77e92eba0_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/8/3288819/38ac3497-cdc1-4e74-b575-2b1259a6eb9a_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/8/3288819/223871ca-9168-40a7-9bdf-647892b58196_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/8/3288819/7